package com.izzaweb.pesonatembalang.kuliner;

import android.support.annotation.NonNull;
import android.support.v7.widget.RecyclerView;
import android.view.LayoutInflater;
import android.view.ViewGroup;

import com.izzaweb.pesonatembalang.R;
import com.izzaweb.pesonatembalang.model.KulinerItem;
import com.izzaweb.pesonatembalang.model.WisataItem;

import java.util.ArrayList;
import java.util.List;

public class KulinerAdapter extends RecyclerView.Adapter<KulinerViewHolder> {
    private List<KulinerItem> list = new ArrayList<>();
    public KulinerAdapter(){}

    public void updateAll(List<KulinerItem> items){
        list.addAll(items);
        notifyDataSetChanged();
    }
    @NonNull
    @Override
    public KulinerViewHolder onCreateViewHolder(@NonNull ViewGroup viewGroup, int i) {
        return new KulinerViewHolder(
                LayoutInflater.from(viewGroup.getContext()).inflate(
                        R.layout.item_kuliner, viewGroup, false
                )
        );
    }

    @Override
    public void onBindViewHolder(@NonNull KulinerViewHolder kulinerViewHolder, int i) {
        kulinerViewHolder.bind(list.get(i));
    }

    @Override
    public int getItemCount() {
        return list.size();
    }
}

package com.nikstudio.beginner;

import android.content.Intent;
import android.os.Handler;
import android.support.v7.app.AppCompatActivity;
import android.os.Bundle;
import android.view.Window;
import android.widget.TextView;


public class SplashScreen extends AppCompatActivity {
    TextView tvSplash;

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);

        //menghilangkan ActionBar
        this.requestWindowFeature(Window.FEATURE_NO_TITLE);
        setContentView(R.layout.activity_splash_screen);

        tvSplash = (TextView) findViewById(R.id.tvSplash);


        final Handler handler = new Handler();
        handler.postDelayed(new Runnable() {
            @Override
            public void run() {
                startActivity(new Intent(getApplicationContext(), MainActivity.class));
                finish();
            }
        }, 3000L); //3000 L = 3 detik
    }
}

